import React, { Component } from 'react';

// create a component
class HomePage extends React.Component {
    state = {
      index : 1,
      users : []
    }
    async componentDidMount(){
      const url = "https://reqres.in/api/users";
      const response = await fetch(url);
      const data = await response.json();
      this.setState({users: data.data});
    }
    render() {
        return (
            <React.Fragment>
                <h1 className="text-center">ReactJS Group 4</h1>
                <h2 className="text-center">UP2022 Web Programming</h2>
                <div className="row mt-3">
                    <div className="col-md-4">
                        <div className="card text-center">
                            <div className="card-header">
                                <h3>Memeber</h3>
                            </div>
                            <div className="card-body">
                                <img src="./sreyrot.jpg" width="100%" alt=""/>
                                <p className="mt-3"><b>Ms.Srey Rot ON</b></p>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-4">
                        <div className="card text-center">
                            <div className="card-header">
                                <h3>Team Leader</h3>
                            </div>
                            <div className="card-body">
                                <img src="./sinat.jpg" width="100%" alt=""/>
                                <p className="mt-3"><b>Ms.Sinat NANG</b></p>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-4">
                        <div className="card text-center">
                            <div className="card-header">
                                <h3>Memeber</h3>
                            </div>
                            <div className="card-body">
                                <img src="./bunsin.jpg" width="100%" alt=""/>
                                <p className="mt-3"><b>Mr.Bunsin NANH</b></p>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default HomePage;
